import React, { Component } from 'react';
import LoginButton from './LoginButton.js';
import '../../css/Landing.css';

class Landing extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="landing">
                <LoginButton/>
            </div>
        )
    }
}

export default Landing;
